# [329] 矩阵中的最长递增路径
#
# https://leetcode-cn.com/problems/longest-increasing-path-in-a-matrix/description/
#
# algorithms
# Hard (37.94%)
# Likes:    53
# Dislikes: 0
# Total Accepted:    2.8K
# Total Submissions: 7.2K
# Testcase Example:  '[[9,9,4],[6,6,8],[2,1,1]]'
#
# 给定一个整数矩阵，找出最长递增路径的长度。
#
# 对于每个单元格，你可以往上，下，左，右四个方向移动。 你不能在对角线方向上移动或移动到边界外（即不允许环绕）。
#
# 示例 1:
#
# 输入: nums =
# [
# ⁠ [9,9,4],
# ⁠ [6,6,8],
# ⁠ [2,1,1]
# ]
# 输出: 4
# 解释: 最长递增路径为 [1, 2, 6, 9]。
#
# 示例 2:
#
# 输入: nums =
# [
# ⁠ [3,4,5],
# ⁠ [3,2,6],
# ⁠ [2,2,1]
# ]
# 输出: 4
# 解释: 最长递增路径是 [3, 4, 5, 6]。注意不允许在对角线方向上移动。
#
#
#


class Solution(object):
    def longestIncreasingPath(self, matrix):
        """
        :type matrix: List[List[int]]
        :rtype: int
        解法1：时间复杂度O(n^2) 
        """
        if not matrix or not matrix[0]:
            return 0
        m, n = len(matrix), len(matrix[0])
        sm = []
        for i in range(m):
            for j in range(n):
                sm.append((matrix[i][j], i, j,))
        sm.sort()

        dxy = [0, 1, 0, -1, 0]
        dp = [[1] * n for i in range(m)]
        for v, i, j in sm:
            for k in range(4):
                di, dj = i + dxy[k], j + dxy[k+1]
                if 0 <= di < m and 0 <= dj < n and matrix[i][j] > matrix[di][dj]:
                    dp[i][j] = max(dp[i][j], dp[di][dj]+1)
        return max(dp[i][j] for j in range(n) for i in range(m))

    def longestIncreasingPath2(self, matrix):
        """
        :type matrix: List[List[int]]
        :rtype: int
        解法2：时间复杂度O(n^3) 会超时
        """
        if not matrix:
            return 0
        self.ret = 0
        dxy = [0, 1, 0, -1, 0]

        def dfs(i, j, path=[], cache=cache):
            if i < 0 or j < 0 or i == m or j == n or (path and matrix[i][j] <= path[-1]):
                self.ret = max(self.ret, len(path))
                return
            for n in range(4):
                dfs(i + dxy[n], j + dxy[n+1], path + [matrix[i][j]], cache)
        for i in range(len(matrix)):
            for j in range(len(matrix[i])):
                dfs(i, j, [])
        return self.ret


print(Solution().longestIncreasingPath([[1]]))
print(Solution().longestIncreasingPath([]))
print(Solution().longestIncreasingPath([[9, 9, 4], [6, 6, 8], [2, 1, 1]]))
print(Solution().longestIncreasingPath([[3, 4, 5], [3, 2, 6], [2, 2, 1]]))
